import React from 'react';
import img from './images/team/John-Nguyen.jpg';

const Team = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <img src={img} />
        </div>
        <div className="col-7">
          <p>Description</p>
        </div>
      </div>
    </div>
  )
}

export default Team;
